window.bookSummaryJSON = "<p><b>Who are my kind?</b></p> <p>Since my stepsister, Nakona Ril, has joined the family, I’ve finally settled into a happy life of cooking and potion brewing at the family inn. But the shadow of war looms ahead, with the fate of the world and my own destiny fast approaching. Monsters are coming, bandits seek to steal my potions, and countries set their sights upon the rumor of a talented alchemist. Why won’t they all just leave me alone?</p>"; 
